import { Grid } from '@mui/material';
import '../../style/footer.css';

function Footer() {
  return (
    <footer>
      <Grid
        container
        className="footer"
        direction="row"
        justifyContent="center"
        alignItems="flex-start"
      ></Grid>
    </footer>
  );
}
export { Footer };
